import { NavLink } from "react-router-dom";
import classes from "./Menu.module.css";


const Menu = () => {
  return (
    <div className={classes.container}>
      <div className={classes.card}><NavLink to="/dashboard">Dashboard</NavLink></div>
      <div className={classes.card}>Update</div>
      <div className={classes.card}>Upload</div>
      <div className={classes.card}>Delete</div>
      <div className={classes.card}>Recommend</div>
    </div>
  );
};

export default Menu;
